  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:48.167943\",\n\t\"name\": \"umatilla-rough-fish-eradication\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In order to enhance environmental conditions
  in the McCormack Slough on Umatilla NWR, the population of rough fish, including
  common carp (Cyprinus carpio) and bullheads (Ameriurus spp.), was treated with rotenone.
  The long term goal of this project was to provide better habitat conditions within
  McCormack slough for wintering waterfowl populations. Removal of carp generally
  results in improved water clarity, increased growth of submerged aquatic vegetation
  (SAV), and larger populations of aquatic invertebrates and small vertebrates, all
  of which can be beneficial to waterfowl and other wildlife. The project was organized
  by Umatilla NWR staff and carried out with help from the entire Mid-Columbia River
  NWR Complex staff.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
